def pk(y_true,y_pred,k):
  if k==0:
    return 0
  y_pred=y_pred[:k]
  pred_set=set(y_pred)
  true_set=set(y_true)
  common_value=pred_set.intersection(true_set)
  return len(common_value)/len(y_pred[:k])

